import React from "react";
import "./Card.css";
import { Link } from "react-router-dom";
interface featuresCardProps{
	heading: string;
	subHeading: string;
}
function FeaturesCardComponent({
	heading,
	subHeading,
	featuresText,
	features,
	buttonText,
	path,
	id,
}) {
	console.log(id, "id");

	return (
		<div className={id === 2 ? "card2Contents" : "sanerNowCardContents"}>
			<div className={id === 2 ? "card2ContentsHeading" : "heading"}>{heading}</div>
			<div className={id===4?"card2SubContents":"subContents"}>
				{subHeading.map((ele, i) => {
					return (
						<div
							className={
								id === 2
									? "card2ContentsSubHeadings"
									: "sub-headings"
							}
						>
							<span>{ele}</span>
						</div>
					);
				})}
			</div>
			<div  className={id === 2 ? "card2ContentsFeaturesText" : "featuresText"}>{featuresText}</div>
			<div className="features">
				{features.map((ele, i) => {
					return (
						<div
							className={
								id === 2
									? "card2ContentsFeatures"
									: "contents"
							}
						>
							<div className={id===2?"card2Circle":"circle-with-tick"}></div>{/* {<CheckCircleOutlineIcon />} */}
							<span>{ele}</span>
						</div>
					);
				})}
			</div>
			<div className={id === 2 ? "card2Button" : "buttons"}>
				<Link
					className={
						id === 2
							? "card2ButtonContentSection"
							: "buttonContentSection"
					}
					to={path}
				>
					{buttonText}
				</Link>
			</div>
		</div>
	);
}

export default FeaturesCardComponent;
